import { connect } from "react-redux";
import { sendOtp, fetchTechnique } from "../../reducers/account/logUp.Reducer";
import LogUp from "../../components/account/LogUp.Component";

const mapStateToProps = (state) => ({
  statusLogUp: state.logUp.statusLogUp,
  isLoading: state.logUp.isLoading,
  error: state.logUp.error,
});

const mapActionToProps = { fetchTechnique };

export default connect(mapStateToProps, mapActionToProps)(LogUp);
